import json
import urllib.parse


class DecryptionProcess:
    """
    Url处理类，需要传入两个实参：Urlchuli('实参数','编码类型')，默认utf-8
    url编码方法：url_bm() url解码方法：url_jm()
    """

    def __init__(self, parameter, mazhi='utf-8'):
        self.parameter = parameter
        self.mazhi = mazhi

    def url_encoding(self):
        """
        url_bm() 将传入的中文实参转为Urlencode编码
        """
        quma = str(self.parameter).encode(self.mazhi)
        bianma = urllib.parse.quote(quma)
        return bianma

    def url_decode(self):
        """
        url_jm() 将传入的url进行解码成中文
        """
        quma = str(self.parameter)
        jiema = urllib.parse.unquote(quma, self.mazhi)
        return jiema

    def decode1(self, _5):
        """
        第一次解密, 将ASCII码为33的赋值125(}),
        将所有ASCII码在[34, 125]之间的值减一, 在转化字符
        :return:
        """
        aList = []
        for i in _5:
            ascii_num = ord(i)
            if ascii_num == 33:
                aList.append(chr(125))
            elif ascii_num >= 34 and ascii_num <= 125:
                aList.append(chr(ascii_num - 1))
            else:
                aList.append(i)
        return "".join(aList)

    def decode2(self, _8):
        a = []
        b = []
        for i in range(len(_8)):
            if i % 2 == 0:
                a.insert(0, _8[i])
            else:
                b.append(_8[i])
        return "".join(b) + "".join(a)

    def decode(self, _7):
        _1 = int(_7[0])
        if _1 >= 1 and _1 <= 5:
            return _7[_1:]

    def decode_response(self):
        res = self.url_decode()
        data_1 = self.decode1(res)  # 第一步解密
        data_2 = self.decode2(data_1)  # 第二步解密
        data_3 = json.loads(self.decode(data_2))  # 第三步还原顺序
        return data_3


